import Scientist from '../resources'

const Home = props => {
  return (
    <div style={{ fontFamily: ['Montserrat'] }}>
      <h2>We make a connection between scholars</h2>
      <h4>
        Connect to your fellows, share your experience or ask any question in
        your research area in the Forum
      </h4>
      <img src="scientist.jpg" alt="" width="500" height="600"/>
    </div>
  )
}

Home.propTypes = {}

export default Home
